import { Component } from '@angular/core';
import { HttpClient } from '@angular/common/http';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./styles.css']
})
export class AppComponent {
  apiUrl = 'https://pg2i4ekj00.execute-api.us-east-1.amazonaws.com/dev/classify';

  isProcessing = false;
  countdown = 15;
  progressPercentage = 0;
  interval: any;

  isHuman: boolean | null = null;
  confidence = 0;
  sagemakerResult = '';
  rekognitionResult = '';
  agreement = false;

  captured = false;
  capturedImage: string | null = null;
  aiBoxes: { left: number, top: number, size: number }[] = [];

  constructor(private http: HttpClient) {}

  captureImage() {
    this.captured = true;
    this.capturedImage = 'assets/sample-face.jpg'; // Replace with actual camera capture logic
    this.generateAiBoxes();
  }

  generateAiBoxes() {
    // Ensure AI boxes appear **only when** an image is captured
    if (!this.captured) {
      this.aiBoxes = [];
      return;
    }

    this.aiBoxes = [];
    for (let i = 0; i < 3; i++) {
      this.aiBoxes.push({
        left: Math.random() * 70 + 15,
        top: Math.random() * 70 + 15,
        size: Math.random() * 30 + 20
      });
    }
  }

  resetCapture() {
    // Reset everything when a new capture is required
    this.captured = false;
    this.capturedImage = null;
    this.aiBoxes = [];
  }
}
